package com.hose.mall.search;import java.io.Serializable;/** * 酒店服务评分 * * @author wangmi wangmi@hosecloud.com */public class ServiceScoreVo implements Serializable {    private static final long serialVersionUID = 5359242686269353518L;    public ServiceScoreVo() {        super();    }    /**     * 主键自增ID     */    private Long id;    /**     * 酒店编号     */    private String hotelNo;    /**     * 服务总评分与同城的水平的对比 百分比，格式是16%，-5%。正数表示比同城水平高，负数表示比同城水平低，0%表示持平。     */    private String summaryRate;    /**     * 及时确认率 百分比，格式是96%     */    private String confirmScore;    /**     * 预订成功率     */    private String successScore;    /**     * 预订成功率与同城的水平的对比     */    private String successRate;    /**     * 用户投诉率 百分比，格式是1%。     */    private String complaintScore;    /**     * 用户投诉率与同城的水平的对比 百分比，格式是16%，-5%。正数表示比同城水平高，负数表示比同城水平低，0%表示持平     */    private String complaintRate;    /**     * 点评总数     */    private Integer reviewCount;    /**     * 好评数     */    private Integer reviewGood;    /***/    private Integer reviewPoor;    /**     * 评分	 已经计算为百分比。周边酒店的评价评分可以自行通过酒店经纬度计算周边酒店，再计算平均评分     */    private String reviewScore;    public Long getId() {        return this.id;    }    public void setId(Long id) {        this.id = id;    }    public String getHotelNo() {        return this.hotelNo;    }    public void setHotelNo(String hotelNo) {        this.hotelNo = hotelNo;    }    public String getSummaryRate() {        return this.summaryRate;    }    public void setSummaryRate(String summaryRate) {        this.summaryRate = summaryRate;    }    public String getConfirmScore() {        return this.confirmScore;    }    public void setConfirmScore(String confirmScore) {        this.confirmScore = confirmScore;    }    public String getSuccessScore() {        return this.successScore;    }    public void setSuccessScore(String successScore) {        this.successScore = successScore;    }    public String getSuccessRate() {        return this.successRate;    }    public void setSuccessRate(String successRate) {        this.successRate = successRate;    }    public String getComplaintScore() {        return this.complaintScore;    }    public void setComplaintScore(String complaintScore) {        this.complaintScore = complaintScore;    }    public String getComplaintRate() {        return this.complaintRate;    }    public void setComplaintRate(String complaintRate) {        this.complaintRate = complaintRate;    }    public Integer getReviewCount() {        return this.reviewCount;    }    public void setReviewCount(Integer reviewCount) {        this.reviewCount = reviewCount;    }    public Integer getReviewGood() {        return this.reviewGood;    }    public void setReviewGood(Integer reviewGood) {        this.reviewGood = reviewGood;    }    public Integer getReviewPoor() {        return this.reviewPoor;    }    public void setReviewPoor(Integer reviewPoor) {        this.reviewPoor = reviewPoor;    }    public String getReviewScore() {        return this.reviewScore;    }    public void setReviewScore(String reviewScore) {        this.reviewScore = reviewScore;    }    @Override    public String toString() {        return "{\"id\":" + this.id + ",\"hotelNo\":\"" + this.hotelNo + "\",\"summaryRate\":\"" + this.summaryRate + "\",\"confirmScore\":\"" + this.confirmScore + "\",\"successScore\":\"" + this.successScore + "\",\"successRate\":\"" + this.successRate + "\",\"complaintScore\":\"" + this.complaintScore + "\",\"complaintRate\":\"" + this.complaintRate + "\",\"reviewCount\":" + this.reviewCount + ",\"reviewGood\":" + this.reviewGood + ",\"reviewPoor\":" + this.reviewPoor + ",\"reviewScore\":\"" + this.reviewScore + "\"}";    }}